import React, { Component } from 'react';
import PropTypes from 'prop-types';
import LayoutNavBase from './base';

export default class LayoutNavRight extends LayoutNavBase {
  constructor(props) {
  	let options = {
  		navStyle: Object.assign({
  			top: "50%",
  			right: "0",
  			transform: "translate(0, -50%)",
  			width: "100px"
  		}, props.navStyle),
  		navLinkStyle: Object.assign({
  			width: "100%",
  			display: "block"
  		}, props.navLinkStyle)
  	};
  	super(props, options);
	}
}

